import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const Test = () => {
  return (
    <>
      <h1>hello world</h1>
      <Container>
        <Row>
          <Col sm={6} md={4}>
            <p>checker viet</p>
          </Col>
          <Col sm={6} md={8}>
            <p>hello my name is dang hoa</p>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Test;
